import React from 'react';
import '../../../../styles/timeline.css'; // Assuming you have CSS files in your project
import timelineMinJs from '../../../../js/timeline-min.js'; // Adjust path as necessary

function MainPage() {
  React.useEffect(() => {
    const embed = document.getElementById('timeline-embed');
    embed.style.height = getComputedStyle(document.body).height;
    window.timeline = new TL.Timeline('timeline-embed', timelineMinJs, {
      hash_bookmark: false
    });
    window.addEventListener('resize', () => {
      embed.style.height = getComputedStyle(document.body).height;
      timeline.updateDisplay();
    });
  }, []);

  return (
    <div>
      <head>
        <title>Superteams Community Bloodline</title>
        <meta name="description" content="Follow Superteams Social Media Photos and Past Events" />
        <meta charset="utf-8" />
        <meta name="viewport" content="initial-scale=1,width=device-width" />
        <meta name="apple-mobile-web-app-capable" content="yes" />
        <meta name="apple-touch-fullscreen" content="yes" />
      </head>
      <body>
        <div id="timeline-embed">
          <div id="timeline"></div>
        </div>
      </body>
    </div>
  );
}

export default MainPage;
